import React from 'react';

const SearchBar = () => {
    return (
        <form>
            <div className='form-row mb-5'>
                <div className='col-12'>
                    <inout type='text' className='form-control' placeholder='Search movie' />
                </div>
            </div>
        </form>
    );
};

export default SearchBar;
